import Navbar from "../../navbar";
import Footer from "../../footer";
import Slider from "./slider";
class home extends Component {
    render() {
        return (
            <div>
            <Navbar />
                <h1>Home Front</h1>
            <Footer />
            </div>
        );
    }
}

export default home;
